import React, { useState } from "react";
import { Box, Button, Flex, styled } from "reakit";
import TrashIcon from "../assets/trash-icon.png";

const Container = styled.div`
  position: fixed;
  background: #00000050;
  width: 100%;
  height: 100vh;
  top: 0;
  left: 0;
`;

const FlexStyled = styled.div`
  position: relative;
  width: 70%;
  margin: 0 auto;
  height: auto;
  max-height: 70vh;
  margin-top: calc(100vh - 85vh - 20px);
  background: #fff;
  border-radius: 4px;
  padding: 20px;
  border: 1px solid #999;
  overflow: auto;
`;

const LogoIcon = styled.img`
  height: 20px;
  width: 20px;
  padding: 12px 0 0 30px;
  cursor: pointer;
  &:hover {
    opacity: 0.8;
  }
`;

const Popup = (props) => {
  return (
    <Container>
      <div>
        <span>x</span>
        {"nesto"}
      </div>
    </Container>
  );
};

export default Popup;
